import React, { useState } from "react";
import { Bar } from "react-chartjs-2";
import "../BarChart.css";

function BarChart({ data, lang, translations }) {
  const universities = [...new Set(data.map(row => row.GEO).filter(Boolean))];
  const fields = [...new Set(data.map(row => row["Field of study"]).filter(Boolean))];
  const genders = [...new Set(data.map(row => row.Gender).filter(Boolean))];
  const years = [...new Set(data.map(row => row.REF_DATE).filter(Boolean))];
  const credentials = [...new Set(data.map(row => row["Credential type"]).filter(Boolean))];

  const [selectedUni, setSelectedUni] = useState(universities[0] || "");
  const [selectedField, setSelectedField] = useState(fields[0] || "");
  const [selectedGender, setSelectedGender] = useState(genders[0] || "");
  const [selectedYear, setSelectedYear] = useState(years[0] || "");

  const filtered = data.filter(row =>
    row.GEO === selectedUni &&
    row["Field of study"] === selectedField &&
    row.Gender === selectedGender &&
    row.REF_DATE === selectedYear &&
    row.VALUE && row["Credential type"]
  );

  const aggregated = {};
  filtered.forEach(row => {
    const credential = row["Credential type"];
    const value = parseInt(row.VALUE) || 0;
    if (!aggregated[credential]) aggregated[credential] = 0;
    aggregated[credential] += value;
  });

  const sorted = Object.entries(aggregated)
    .map(([credential, total]) => ({ credential, total }))
    .sort((a, b) => a.total - b.total);

  const chartData = {
    labels: sorted.map(d => d.credential),
    datasets: [
      {
        label: `${translations.barChart} - ${selectedField} - ${selectedGender}`,
        data: sorted.map(d => d.total),
        backgroundColor: sorted.map((_, i) => `hsl(${(i * 360) / sorted.length}, 70%, 60%)`),
      }
    ]
  };

  return (
    <div className="bar-chart-container">
      <h2>{translations.barChart}</h2>

      <div className="bar-chart-filters">
        <div className="dropdown-block">
          <label>{translations.selectUni}</label>
          <select value={selectedUni} onChange={e => setSelectedUni(e.target.value)}>
            {universities.map(u => <option key={u}>{u}</option>)}
          </select>
        </div>

        <div className="dropdown-block">
          <label>{translations.selectField}</label>
          <select value={selectedField} onChange={e => setSelectedField(e.target.value)}>
            {fields.map(f => <option key={f}>{f}</option>)}
          </select>
        </div>

        <div className="dropdown-block">
          <label>{translations.selectStatus.replace("Registration ", "Gender ")}</label>
          <select value={selectedGender} onChange={e => setSelectedGender(e.target.value)}>
            {genders.map(g => <option key={g}>{g}</option>)}
          </select>
        </div>

        <div className="dropdown-block">
          <label>{translations.selectYear}</label>
          <select value={selectedYear} onChange={e => setSelectedYear(e.target.value)}>
            {years.map(y => <option key={y}>{y}</option>)}
          </select>
        </div>
      </div>

      <div className="chart-wrapper">
        <Bar data={chartData} />
      </div>
    </div>
  );
}

export default BarChart;
